$(".material-ripple").click(function(i){var t=$(this);0==t.find(".ink").length&&t.prepend("<div class='ink'></div>");var e=t.find(".ink");if(e.removeClass("animate"),!e.height()&&!e.width()){var a=Math.max(t.outerWidth(),t.outerHeight());e.css({height:a,width:a})}var h=i.pageX-t.offset().left-e.width()/2,d=i.pageY-t.offset().top-e.height()/2,r=t.data("ripple-color");e.css({top:d+"px",left:h+"px",background:r}).addClass("animate")});